import React from "react";
import classes1 from "../gym/assets/classes-1.jpg";
import classes2 from "../gym/assets/classes-2.jpg";
import classes3 from "../gym/assets/classes-3.jpg";
import classes4 from "../gym/assets/classes-4.jpg";
import classes5 from "../gym/assets/classes-5.jpg";
import classes6 from "../gym/assets/classes-6.jpg";

const Classes = () => {
  const imag = [
    { icon: classes1 },
    { icon: classes2 },
    { icon: classes3 },
    { icon: classes4 },
    { icon: classes5 },
    { icon: classes6 },
  ];
  return (
    <section className="section__container classes__container" id="classes">
      <p className="section__subheader">YOGA CLASSES</p>
      <h2 className="section__header">Choose Your Level & Focus</h2>
      {imag.map((img) => (
        <div className="classes__grid" >
           <div className="classes__image">
          <img src={img} alt="classes" />
          <div className="classes__content">
            <button className="btn classes__btn">View More</button>
          </div>
        </div>
          {/* Repeat for other classes */}
        </div>
      ))}
    </section>
  );
};

export default Classes;
